import { useState,useRef} from "react";
const AddButton = () => {
    const [isActive, setIsActive] = useState(false);
    const knopka =useRef()
    const click = () => {
        isActive ? setIsActive(true) : setIsActive()
    }
    return (
        <button ref={knopka} onClick={click()} className={isActive ? 'active' : ''}>
            Add
        </button>
    );
};
export default AddButton;
